import React from "react";
import "./Dice.scss"

type DiceProps = {
    header: string,
    options: string[]
}

const Dice: React.FC<DiceProps> = ({header, options}) => {

    return (
        <div className="Dice">
            <h4>{header}</h4>
        </div>
    )
};

export default Dice
